import React from 'react';

import { Container, Form, Logo} from './styles';

const Logon: React.FC = () => {
  return (
    <Container>
      <Logo/>
      <Form>
        <input type="text"/>
        <input type="text"/>
        <button>Logar</button>
      </Form>
    </Container>
  );
};

export default Logon;
